      branch: c0943b21872eacb5bb6cb8702a5ef26436cc6930
      repo: git@github.com:googleapis/google-cloud-dotnet.git
    id: MaxStaleness
    path: ../../../apis/Google.Cloud.Spanner.V1/Google.Cloud.Spanner.V1/Transaction.cs
    startLine: 1079
  assemblies:
  - Google.Cloud.Spanner.V1
  namespace: Google.Cloud.Spanner.V1
  summary: "\nRead data at a timestamp >= `NOW - max_staleness`\nseconds. Guarantees that all writes that have committed more\nthan the specified number of seconds ago are visible. Because\nCloud Spanner chooses the exact timestamp, this mode works even if\nthe client&apos;s local clock is substantially skewed from Cloud Spanner\ncommit timestamps.\n\nUseful for reading the freshest data available at a nearby\nreplica, while bounding the possible staleness if the local\nreplica has fallen behind.\n\nNote that this option can only be used in single-use\ntransactions.\n"
  example: []
  syntax:
    content: public Duration MaxStaleness { get; set; }
    parameters: []
    return:
      type: Google.Protobuf.WellKnownTypes.Duration
    content.vb: Public Property MaxStaleness As Duration
