  source:
    remote:
      path: apis/Google.Cloud.Spanner.V1/Google.Cloud.Spanner.V1/Transaction.cs
      branch: c0943b21872eacb5bb6cb8702a5ef26436cc6930
      repo: git@github.com:googleapis/google-cloud-dotnet.git
    id: ReadTimestamp
    path: ../../../apis/Google.Cloud.Spanner.V1/Google.Cloud.Spanner.V1/Transaction.cs
    startLine: 1104
  assemblies:
  - Google.Cloud.Spanner.V1
  namespace: Google.Cloud.Spanner.V1
  summary: "\nExecutes all reads at the given timestamp. Unlike other modes,\nreads at a specific timestamp are repeatable; the same read at\nthe same timestamp always returns the same data. If the\ntimestamp is in the future, the read will block until the\nspecified timestamp, modulo the read&apos;s deadline.\n\nUseful for large scale consistent reads such as mapreduces, or\nfor coordinating many reads against a consistent snapshot of the\ndata.\n\nA timestamp in RFC3339 UTC \\&quot;Zulu\\&quot; format, accurate to nanoseconds.\nExample: `&quot;2014-10-02T15:01:23.045123456Z&quot;`.\n"
  example: []
  syntax:
    content: public Timestamp ReadTimestamp { get; set; }
    parameters: []
    return:
      type: Google.Protobuf.WellKnownTypes.Timestamp
    content.vb: Public Property ReadTimestamp As Timestamp
  overload: Google.Cloud.Spanner.V1.TransactionOptions.Types.ReadOnly.ReadTimestamp*
